result:
.table {
    .ivu-table-default{
        overflow-y: auto;
        max-height: 350px;
    }
}
.dashboard-workplace {
    &-header {
        &-avatar {
            width: 64px;
            height: 64px;
            border-radius: 50%;
            margin-right: 16px;
            font-weight: 600;
        }

        &-tip {
            width: 82%;
            display: inline-block;
            vertical-align: middle;

            &-title {
                font-size: 13px;
                color: #000000;
                margin-bottom: 12px;
            }

            &-desc {
                &-sp {
                    width: 33.33%;
                    color: #17233D;
                    font-size: 12px;
                    display: inline-block;
                }
            }
        }

        &-extra {
            .ivu-col {
                p {
                    text-align: right;
                }

                p:first-child {
                    span:first-child {
                        margin-right: 4px;
                    }

                    span:last-child {
                        color: #808695;
                    }
                }

                p:last-child {
                    font-size: 22px;
                }
            }
        }
    }
}
